import React, {useState} from 'react';
import BasicButton from "../../components/button/BasicButton";
import { faCheck } from "@fortawesome/free-solid-svg-icons";
import Icon from "../../components/icons/Icon";
import Text from "../../components/text/size";
import BasicInput from "../../components/input/BasicInput";
import S from "../../components/input/style";
import ErrorInput from "../../components/input/ErrorInput";
import PasswordInput from "../../components/input/PasswordInput";
import Button from "../../components/button/style";
import ButtonWithInput from "../../components/input/ButtonWithInput";
import { ReactComponent as CalendarIcon } from "../../components/icons/calendar.svg";
import { ReactComponent as ArrowDownIcon } from "../../components/icons/arrow-down.svg";
import { ReactComponent as ArrowUpIcon } from "../../components/icons/arrow-up.svg";
import { ReactComponent as SearchIcon } from "../../components/icons/search.svg";
import { ReactComponent as ArrowRightIcon } from "../../components/icons/arrow-right.svg";
import { ReactComponent as CloseIcon } from "../../components/icons/close.svg";
import Checkbox from "../../components/checkbox/Checkbox";
import CheckboxWithLabel from "../../components/checkbox/CheckboxWithLabel";
import RadioWithLabel from "../../components/radio/RadioWithLabel";
import Radio from "../../components/radio/Radio";
import SelectBox from "../../components/selectBox/SelectBox";
import Accordion from "../../components/accordion/Accordion";
import PopupCard from "../../components/popUp/PopupCard";


const Main = () => {


    return (
        <section>
            <Text.H1 fontWeight={600} mt="100" p={100} color={"blue"}>안녕하세요!!</Text.H1>
            <Text.Caption2 mt="50" fontWeight={900} color={"orange"}>헬로</Text.Caption2>

            <BasicButton basicButton="superSmall" variant="gray">
                텍스트
                <ArrowRightIcon width={30} height={30}/>
            </BasicButton>
            <Text.Body2 color={"red"}>정지우입니다</Text.Body2>

            {/*인풋 감싸는 전체 영역*/}
            <S.InputWrapper mt="30" mb="30">
                {/*기본 인춧*/}
                <BasicInput type="text" placeholder="아이디를 입력하세요" />
                {/*비밀번호 전용 인풋*/}
                <PasswordInput/>
                {/*인풋 + 버튼*/}
                <ButtonWithInput
                    placeholder="아이디를 입력하세요"
                    buttonText="중복확인"
                    variant="default"
                />

                {/*인풋 + 버튼*/}
                <ButtonWithInput
                    placeholder="아이디를 입력하세요"
                    buttonText="사용가능"
                    variant="filled"
                />


                {/*인풋  + 캘린더 아이콘*/}
                <S.InputButtonWrapper>
                    <BasicInput type="text" placeholder="" />
                    <CalendarIcon width={30} height={30} />
                </S.InputButtonWrapper>

                {/*인풋 + 아래로 향하는 화살표*/}
                <S.InputButtonWrapper>
                    <BasicInput type="text" placeholder="" />
                    <ArrowDownIcon width={30} height={30} />
                </S.InputButtonWrapper>


                {/*인풋 + 검색 아이콘*/}
                <S.InputButtonWrapper>
                    <BasicInput type="text" placeholder="" />
                    <SearchIcon width={30} height={30} />
                </S.InputButtonWrapper>

                {/*인풋 + 닫기 아이콘*/}
                <S.InputButtonWrapper>
                    <BasicInput type="text" placeholder="" />
                    <CloseIcon width={30} height={30} />
                </S.InputButtonWrapper>


                {/*인풋 + 위로 향하는 화살표 아이콘*/}
                <S.InputButtonWrapper>
                    <BasicInput type="text" placeholder="" />
                    <ArrowUpIcon width={30} height={30} />
                </S.InputButtonWrapper>

                {/*인풋 + 텍스트*/}
                <S.InputButtonWrapper>
                    <BasicInput type="text" placeholder="" />
                    <Text.Body3>kg</Text.Body3>
                </S.InputButtonWrapper>

                <ErrorInput type="text" placeholder="비밀번호를 입력해주세요." mt="30" />

                {/*셀렉박스*/}
                <SelectBox
                    options={['정지우', '이민주', '박희진' , '김유진' ]}
                    placeholder="선택하세요."
                    onSelect={(v) => console.log('선택된 값:', v)}
                />
            </S.InputWrapper>

            {/*기본 체크박스*/}
            <Checkbox />

            {/*체크박스 + 텍스트*/}
            <CheckboxWithLabel label="ddfdf"/>

            {/*라디오버튼 + 텍스트*/}
            <RadioWithLabel size="L" label="Text 1" mt="30" />
            <RadioWithLabel size="L" label="Text 2" />
            <RadioWithLabel size="M" label="Text 3" />
            <RadioWithLabel size="S" label="Text 4" />

            {/*기본 라디오 버튼*/}
            <Radio size="M" mt="20"/>

            {/*아코디언*/}
            <div>
                <Accordion
                    question="Q. 환불은 어떻게 하나요?"
                    answer="A. 마이페이지 > 결제내역에서 환불 요청이 가능합니다."
                />

                <Accordion
                    question="Q. 위치는 어디에요?"
                    answer="A. 주소 내역에서 보실 수 있습니다."
                />

                <Accordion
                    question="Q. 강아지는 몇명까지 등록 가능해요?"
                    answer="A. 총 1마리만 등록 가능합니다."
                />
            </div>


            <PopupCard
                title="친구가 추천을 보냈어요!"
                actions={[
                    { label: "추천하기", onClick: handleConfirm, type: "primary" },
                ]}
            />


        </section>
    );
};








export default Main;
